import React from 'react';
import '../../src/Style/services.css';
import {useHistory} from 'react-router-dom';

const Services = ()=>{
    
    const personalLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./personal_loan.jpg')`
    };

    const bikeLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./bike_loan.jpg')`
    };

    const carLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./car_loan.jpg')`
    };

    const homeLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./home_loan.png')`
    };

    return(


        <div>
            <div style={personalLoanStyle} class="personal-loan">
            
            </div>
            <div style={bikeLoanStyle} class="bike-loan">
               
                
            </div>
            <div style={carLoanStyle} class="car-loan">
                
                
            </div>
            <div style={homeLoanStyle} class="home-loan">
                
                
            </div>

        </div>
        

    );

};

export default Services;
